import './cuisineCard.css';
import logo from '../../assets/cuisine/asian.png';

function CuisineCard({cuisine}) {

    return (
        <div>
            <p>{cuisine}</p>
            <img src={logo}/>
        </div>

    )
}

export default CuisineCard;
